_Total_Gross_Written_1.query:
q = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";
q = filter q by 'POLICY_EXPIRED' == "ACTIVE";
q = group q by all;
q = foreach q generate sum('written_base_premium') as 'sum_GrossWrittenPremium';
q = limit q 2000;

closed_won_quarter_1.query:
q = load "${App.Datasets.InsOpportunities_tp.FullyQualifiedName}";
q = filter q by 'StageName' == "Closed Won";
q = group q by all;
q = foreach q generate sum('Amount') as 'sum_Amount';

Total_Customers_1.query:
q = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";
q = filter q by 'POLICY_EXPIRED' == "ACTIVE";
q = group q by all;
q = foreach q generate unique('POLICY_ID') as 'unique_PolicyOwner_Id';
q = limit q 2000;

Average_loss_ratio_1.query:
q = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";
result = group q by all;
result = foreach result generate sum(q.'written_base_premium') as 'A', avg(q.'written_base_premium') as 'B', sum(q.'claim_payment') as 'C';
result = foreach result generate 'A', 'B', 'C', coalesce(C / A,0) as 'D';
result = limit result 1;

Open_Leads_Today_1.query:
q = load "${App.Datasets.InsLeads_tp.FullyQualifiedName}";
q = filter q by 'Status' !in ["Qualified - Convert"];
q = group q by all;
q = foreach q generate count() as 'count';
q = limit q 2000;

Open_Leads_by_create_1.query:
q = load "${App.Datasets.InsLeads_tp.FullyQualifiedName}";
q = filter q by 'Status' !in ["Qualified - Convert"];
q = group q by ('CreatedDate_Year', 'CreatedDate_Month');
q = foreach q generate 'CreatedDate_Year' + "~~~" + 'CreatedDate_Month' as 'CreatedDate_Year~~~CreatedDate_Month', count() as 'count';
q = order q by 'CreatedDate_Year~~~CreatedDate_Month' asc;
q = limit q 2000;

ActivitiesByType_1.query:
q = load "${App.Datasets.InsActivities_tp.FullyQualifiedName}";
q = group q by 'TaskSubtype';
q = foreach q generate 'TaskSubtype' as 'TYPE', count() as 'count';
q = order q by 'TYPE' asc;
q = limit q 2000;

Up_sell_Opportunity__1.query:
q0 = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";

q0 = filter q0 by 'POLICY_EXPIRED' in ["ACTIVE"];

q = group q0 by ('Insurance_PRODUCT_TYPE', 'POLICY_ID', 'Insurance_PRODUCT_NAME');

q = foreach q generate 'Insurance_PRODUCT_TYPE' as 'Policy_PolicyType', 'POLICY_ID' as 'InsurancePolicyId', 'Insurance_PRODUCT_NAME' as 'CoverageName', count() as 'count', sum('written_base_premium') as 'PremiumAmount',  1 as 'Counter';

q = group q by ('Policy_PolicyType', 'InsurancePolicyId', 'CoverageName');

q = foreach q generate 'Policy_PolicyType' as 'Policy_PolicyType', 'InsurancePolicyId' as 'InsurancePolicyId', 'CoverageName' as 'CoverageName', sum('count') as 'count', sum('PremiumAmount') as 'PremiumAmount', sum(sum('Counter')) over([..0] partition by ('Policy_PolicyType','InsurancePolicyId') order by 'CoverageName') as 'Policy_Counter', 1 as 'Coverage_Counter';

q = foreach q generate 'Policy_PolicyType' as 'Policy_PolicyType', 'InsurancePolicyId' as 'InsurancePolicyId', 'CoverageName' as 'CoverageName', 'count' as 'count', 'PremiumAmount' as 'PremiumAmount', case when 'Policy_Counter' > 1 then 0 else 1 end as 'Policy_Counter', 'Coverage_Counter' as 'Coverage_Counter';

result = group q by ('Policy_PolicyType', 'CoverageName');

result = foreach result generate 'Policy_PolicyType', 'CoverageName', round(coalesce((sum(sum('Policy_Counter')) over([..] partition by 'Policy_PolicyType') - sum('Coverage_Counter')) * sum('PremiumAmount')/sum('count'),0),2) as 'sum_Opportunity Size', (sum(sum('Policy_Counter')) over([..] partition by 'Policy_PolicyType') - sum('Coverage_Counter')) as '# Policies';

result = order result by 'sum_Opportunity Size' desc;

result = limit result 1;

Insurance_PRODUCT_NA_1.query:
q = load "${App.Datasets.Insurance_tp.FullyQualifiedName}";
result = group q by ('Insurance_PRODUCT_NAME', 'Insurance_PRODUCT_FAMILY');
result = foreach result generate q.'Insurance_PRODUCT_NAME' as 'Insurance_PRODUCT_NAME', q.'Insurance_PRODUCT_FAMILY' as 'Insurance_PRODUCT_FAMILY', sum(q.'written_base_premium') as 'A', avg(q.'written_base_premium') as 'B', sum(q.'claim_payment') as 'C';
result = foreach result generate 'Insurance_PRODUCT_NAME' as 'Product Name', 'Insurance_PRODUCT_FAMILY' as 'Product Family', 'A', 'B' as 'avg_GWP', 'C', coalesce(C / A,0) as 'D';
result = order result by ('Product Name' asc, 'Product Family' asc);
result = limit result 1;

all_1.query:
q = load "${App.Datasets.InsActivities_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate count() as 'count';
q = limit q 2000;

Performance_against__1.query:
q = load "${App.Datasets.InsOpportunities_tp.FullyQualifiedName}";
q = filter q by 'StageName' == "Closed Won";
quota = load "${App.Datasets.InsQuota_tp.FullyQualifiedName}";
r = group q by all, quota by all;
r = foreach r generate round(coalesce(sum(q.'Amount')/sum(quota.'QuotaAmount'),0) * 100,2) as '% Quota achieved';
